var Contact;

Contact = require('../models/contact');

module.exports.all = function(req, res) {
  return Contact.all(function(err, contacts) {
    if (err != null) {
      return res.status(500).send({
        error: 'server_error_retrieve_data'
      });
    } else {
      return res.status(200).send(contacts);
    }
  });
};
